INSERT INTO `language_translations` VALUES (1,'teaser',1,'ua','technologies','Підготовка до вступу в спеціальність тестувальника за ISTQB',1),(2,'name',1,'ua','technologies','Практичне тестування по ISTQB',1),(3,'html',1,'ua','technologies','<p><a href=\"https://softserve.ua/press-center/news/more-service-from-softserve-it-academy/\">Детальніше&hellip;</a></p>\r\n<h3>Що ми пропонуємо?</h3>\r\n<ul>\r\n<li>Ви отримаєте теоретичні знання та практичні навики тестування програмного забезпечення за визнани',1),(4,'name',2,'ua','technologies','HTML5/ CSS3/ JavaScript Fundamentals',1),(5,'teaser',2,'ua','technologies','Web-розробка для початківців',1),(6,'html',2,'ua','technologies','<p><a href=\"https://softserve.ua/press-center/news/more-service-from-softserve-it-academy/\">Детальніше&hellip;</a></p>\r\n<h3>Що ми пропонуємо?</h3>\r\n<ul>\r\n<li>Разом з професіоналами своєї справи Ви отримаєте всі необхідні знання для того, щоб почати розроб',1),(7,'name',3,'ua','technologies','Java development',1),(8,'teaser',3,'ua','technologies','Розробка Web-аплікацій з використанням Java технологій',1),(9,'html',3,'ua','technologies','<h3>Що ми пропонуємо?</h3>\r\n<ul>\r\n<li>Орієнтуючись на практичні знання, у Вас буде можливість в рамках платформи Java EE вивчити доступ до серверів реляційних баз даних засобами ORM Tools (Hibernate), JPA, JTA, JDBC.</li>\r\n<li>За смачною кавою, Ви будете ',1),(10,'name',4,'ua','technologies','.NET Development',1),(11,'teaser',4,'ua','technologies','Розробка Web-програм засобами С# .NET ',1),(12,'html',4,'ua','technologies','<h4>Що ми пропонуємо?</h4>\r\n<ul>\r\n<li>У серці найбільшої української IT-компанії у вас буде можливість вивчити технології та підходи до розробки Web-програм з багаторівневою архітектурою засобами мови C# і технології .NET Framework із застосуванням сучасн',1),(13,'name',5,'ua','technologies','IOS',1),(14,'teaser',5,'ua','technologies','Розробка додатків для iPhone/iPad',1),(15,'html',5,'ua','technologies','<h3>Що ми пропонує