li>\n<li>Опануєте но',1),(28,'name',10,'ua','technologies','LAMP',1),(29,'teaser',10,'ua','technologies','Розробка Web-орієнтованого Програмного Забезпечення(ПЗ) для Linux з використанням Python/Django або Ruby-on-Rails',1),(30,'html',10,'ua','technologies','<h3>Що ми пропонуємо?</h3>\n<ul>\n<li>Ви вивчите такі мови програмування як Python або Ruby.</li>\n<li>Отримаєте доступ до унікальних інформаційних ресурсів та зрозумієте тонкощі роботи з операційними системами Linux.</li>\n<li>LAMP-розробники з великим практ',1),(31,'name',11,'ua','technologies','Web UI',1),(32,'teaser',11,'ua','technologies','Створення кросбраузерних Web-сторінок з використанням мов HTML та CSS',1),(33,'html',11,'ua','technologies','<h3>Що ми пропонуємо?</h3>\r\n<ul>\r\n<li>Разом з справжніми професіоналами своєї справи Ви отримаєте актуальні знання зі створення HTML-розмітки і застосування CSS-стилів. Ви дізнаєтесь як зробити вашу верстку надійною, сучасною і кросбраузерною.</li>\r\n<li>К',1),(34,'name',12,'ua','technologies','Web UI (Full Stack)',1),(35,'teaser',12,'ua','technologies','Розробка Web-додатків з використанням JavaScript',1),(36,'html',12,'ua','technologies','<h3>Що ми пропонуємо?</h3>\n<ul>\n<li>Ви отримаєте практичний досвід у створенні багаторівневих, інтерактивних та складних web-додатків. Дізнайтесь тонкощі використання мови JavaScript і об’єктно-орієнтованих фреймворків на її основі (ExtJS або Backbone).</',1),(37,'name',13,'ua','technologies','UX',1),(38,'teaser',13,'ua','technologies','Вивчення фундаментальних принципів User Centered Design методології та проектування людино-машинної взаємодії (HCI)',1),(39,'html',13,'ua','technologies','<p><strong>Чого Ви навчитесь?</strong></p>\n<ul>\n<li>Отримаєте практичний досвід роботи з сучасними методами UX дизайну;</li>\n<li>Навчитесь об’єднувати в одне ціле форму та зміст проектного рішення;</li>\n<li>Дізнаєтеся як проектувати інтерфейси мобільних д',1),(40,'name',14,'ua','technologies','Quality Control for Cloud Computing',1),(41,'teaser',14,'ua','technologies','Ручне тестування програмного забезпечення',1),(42,'html',14,'ua','technologies','<h3>Що ми пропонуємо?</h3>\n<ul>\n<li>За сучасними методами підготовки, Ви отримаєте теоретичні та практичні навички ручного керування якістю програмних продуктів.</li>\n<li>На прикладах реальних проектів, Ви вивчите техніки та інструменти аналізу вимог до п',1),(43,'name',15,'ua','technologies','C\\C++',1),(44,'teaser',15,'ua','technologies','Розробка кросплатформенних додатків засобами С++',1),(45,'html',15,'ua','technologies','<h3>Що ми пропонуємо?</h3>\n<ul>\n<li>Орієнтуючись на практичні знання, у Вас буде можливість в рамках стандартної бібліотеки С++ освоїти основні підходи до розробки кросплатформенного програмного забезпечення</li>\n<li>Поряд із досвідченними С++ спеціаліста',1),(46,'name',16,'ua','technologies','Delphi',1),(47,'teaser',16,'ua','technologies','',1),(48,'html',16,'ua','technologies','',1),(49,'name',17,'ua','technologies','Other',1),(50,'teaser',17,'ua','technologies','',1),(51,'html',17,'ua','technologies','',1),(52,'name',1,'en','technologies','ISTQB Practical Testing',2),(53,'teaser',1,'en','technologies','Preparation for application on testing specialty according to ISTQB',2),(54,'html',1,'en','technologies','<p><a href=\"https://softserve.ua/en/press-center/news/more-service-from-softserve-it-academy/\">Read more&hellip;</a></p>\r\n<h4>What do we suggest?</h4>\r\n<ul>\r\n<li>You will get theoretical knowledge and practical skills in software testing according to reco',2),(55,'name',18,'ua','technologies','Java development for non-IT people',1),(56,'teaser',18,'ua','technologies','Розробка Web-аплікацій з використанням Java технологій',1),(57,'html',18,'ua','technologies','<h2><strong>Що ми пропонуємо?</strong></h2>\n<ul>\n<li>Орієнтуючись на практичні знання, у Вас буде можливість в рамках платформи Java EE вивчити доступ до серверів реляційних баз даних.</li>\n<li>За смачною кавою, Ви будете розробляти Web-аплікації з в